        int i = 1;
        int8 i8b = -128;
        int8 i8e = 127;
        int16 i16b = -32768;
        int16 i16e = 32767;
        return (b, i, i8b, i8e, i16b, i16e);
    }

    function getUintTypes() public pure returns (int256, int256, uint256, uint256) {
        int256 i256b = -2**255;
        int256 i256e = 2**255-1;
        uint256 ui256b = 0;
        uint256 ui256e = (2**255)-1;
        return (i256b, i256e, ui256b, ui256e);
    }
}

contract GasComparison {
    uint256 public value256;  // Gas: ~43,724
    uint128 public value128;  // Gas: ~43,746 (更多！)
    uint8 public value8;      // Gas: ~43,770 (最多！)
}

